import React from 'react'
import { useSelector } from 'react-redux'
import './Home.css'

const Home = () => {
    const users = useSelector(state => state.users)
    return (
        <table>
        <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Address</th>
            <th>Action</th>
            </tr>
            
                {
                    users.map(user => {
                        return (<tr key = {user.id}>
                            <td>{user.name}</td>
                            <td>{ user.email}</td>
                            <td>{ user.address}</td>
                            <td></td>
                        </tr>)
                    })
                }
            
  
</table>

    )
}

export default Home
